css:
@-moz-document domain("yggtorrent.com") {
.navbar-inverse {
    background: #0a3356;
}
.navbar {

    position: relative;
    min-height: 50px;
}



body {
      background: #f3f3f3;
    }

.content-box, .content-box-large {
    background: #fff;
    }

.table-striped>tbody>tr:nth-child(odd)>td, .table-striped>tbody>tr:nth-child(odd)>th {
    background-color: rgba(197, 203, 208, 0.45);
    }


.ygg-navbar-input {
    border-radius: 10px;
    background: #27262d;
}


.col-md-offset-2 {
    margin-left: 0%;
}

.sidebar .nav>li>a {
    background: #0a3356!important;
    }

.sidebar .nav>li>ul>li>a {
    font-size: 13px;
    line-height: 20px;
    padding: 2px;
    color: #060000;
    background: rgb(255, 255, 255);
    display: block;
    text-decoration: none;
    border-top: 0px;
    /* font-weight: bold; */
}    
    
.content-box-header {

    background: #0d3456;
    }

td.tabledata1 {
    background-color: rgb(13, 52, 86);
    padding: 5px 10px;
    border: 1px rgba(223,232,238,0.05) solid;
    color: white;
}

.content-box-large {
    padding: 10px;
    }

.page-content>.row {
    margin-left: 10%!important;
    margin-right: 10%!important;
    margin-top: 10px;
   }  
    

td.tabledata0 {
    background-color: rgb(255, 255, 255);
    padding: 5px 10px;
    color: black;
    border: 1px rgba(0, 0, 0, 0.21) solid;
     } 

a {
    color: #0b046d;
    text-decoration: double;
}



element.style {
    text-align: center;
    background: rgba(218, 181, 181, 0.52);
}



element.style {
    color: #1b039a;
}

.order_panel {
    border: 1px solid rgba(241,241,241,0.15);
    background: rgb(13, 52, 86);
    border-radius: 4px;
    padding: 15px;
}

.order_panel > legend { display:none }

td:nth-child(1) > span { display:none }
td:nth-child(1) > a:nth-child(3)  { display:none }
td:nth-child(1) > a:nth-child(4) { display:none }

}
